function isValid(s) {
  let obj = {};
  [...s].forEach((c) => {
    obj[c] = (obj[c] || 0) + 1;
  });
  console.log(obj);
  let keys = Object.keys(obj);
  let prev = obj[keys[0]];
  let allow = 1;
  for (let i = 1; i < keys.length; i++) {
    const elem = obj[keys[i]];
    if (elem !== prev) {
      if (Math.abs(elem - prev) === allow) {
        prev = elem - allow;
        allow--;
      } else if (elem === allow) {
        allow--;
      } else {
        return "NO";
      }
    }
  }
  return "YES";
}

console.log(
  isValid(
    ""
  )
);
